DROP TABLE IF EXISTS "dublin_doctor_clinic" CASCADE;

CREATE TABLE "dublin_doctor_clinic" ( "pkid" SERIAL not null PRIMARY KEY,
  "wkb_geometry" geometry,
  "id" VARCHAR(254),
  "amenity" VARCHAR(254),
  "building" VARCHAR(254),
  "name" VARCHAR(254),
  "type" VARCHAR(254)
 );

CREATE INDEX "dublin_doctor_clinic_wkb_geometry_geom_idx" ON "dublin_doctor_clinic" USING GIST ("wkb_geometry");


